import { Link } from '@chakra-ui/react'
import { ExternalLinkIcon } from '@chakra-ui/icons'
function ResumePage() {
  return (
    <ChakraProvider>
<VStack spacing={7} paddingTop={5}>
<Heading size='xl' ></Heading>
<Text>Where do you want to go?</Text>
</VStack>
</ChakraProvider>
  );
}
export default ResumePage
